import React from "react";
import { Link } from "react-router-dom";
import ("./styling/NavBarFooter.css");


const Footer = props => {
    return(

        <footer className="footerContainer">
            <Link className="text" to="/about">About</Link>
        </footer>
    )
}

export default Footer;
